import './App.css';
import React from 'react';

export default class App extends React.Component {
  render() {
    return (
    <div className="root">

    <Name />
    <Header />
    <Introduction  />

    </div>
    );
  }
}

class Header extends React.Component {
  render(){
    return (
      <div className="header">
        <Tab name="about me"/>
        <Tab name="courses"/>
        <Tab name="projects"/>
        <Tab name="blog"/><p>&U+1F517;</p>
      </div>
    );
  }
}

class Tab extends React.Component {
  render() {
    return (
      <div className="Tab">
      <h3>{this.props.name}</h3>
      </div>
    );
  }
}
class Name extends React.Component {
  render(){
    return (
      <div className="name">
          <a href="#Hello"><h1> Emad Siddiq </h1></a>

      </div>
    );
  }
}
class Introduction extends React.Component{
  render(){
    return(
    <div className="introduction">
      <img src="portrait.jpg" height="400" width="300" alt='me with a grad cap'/>
      <h1 id="Hello">Hello jee :)</h1>
      </div>
    );
  }
}
